import React from 'react';
import MonthlyChart from '~/pages/chart.js';
import MonthlyClock from '~/pages/clock.js';

const data = [
    { month: 'Jan', usage: 5, amount: 50 },
    { month: 'Feb', usage: 7, amount: 70 },
    { month: 'Mar', usage: 9, amount: 90 },
    { month: 'Apr', usage: 4, amount: 40 },
    { month: 'May', usage: 6, amount: 60 },
    { month: 'Jun', usage: 8, amount: 80 },
    { month: 'Jul', usage: 7, amount: 70 },
    { month: 'Aug', usage: 8, amount: 80 },
    { month: 'Sep', usage: 4, amount: 40 },
    { month: 'Oct', usage: 5, amount: 50 },
    { month: 'Nov', usage: 7, amount: 70 },
    { month: 'Dec', usage: 9, amount: 90 },
];

const datas = [
    { name: 'Jan', waterUsage: 50 },
    { name: 'Feb', waterUsage: 700 },
    { name: 'Mar', waterUsage: 9 },
    { name: 'Apr', waterUsage: 4 },
    { name: 'May', waterUsage: 6 },
    { name: 'Jun', waterUsage: 0.8 },
    { name: 'Jul', waterUsage: 0.7 },
    { name: 'Aug', waterUsage: 0.8 },
    { name: 'Sep', waterUsage: 0.4 },
    { name: 'Oct', waterUsage: 0.5 },
    { name: 'Nov', waterUsage: 0.7 },
    { name: 'Dec', waterUsage: 0.9 },
];

const App = () => {
    return (
        <div>
            <h1>Monthly Water Consumption and Bill</h1>
            <MonthlyChart data={data} />
            <MonthlyClock data={datas} />
        </div>
    );
};

export default App;
